import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import React from 'react';
import Slider from "react-slick";


export default function PlayerCarousel() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
    };

    return (
      <Slider {...settings}>
        <div>
            <div class="tile">
              <h3>Registered Players. </h3>
              <p > # of Registerd Players. </p>
            </div>

            <div class="tile">
              <h3>All Players</h3>
              <p > # of All Players</p>
            </div>

        </div>

        <div>
          <div class="tile">
            <p >This is slider 2. </p>
          </div>

        </div>
      </Slider>
    );
  }
